import style from './searchbar.module.css';
export default function SearchBar(props) {
   return (
      <div className={style.container}>
         <input className={style.input} type='search' />
         <button className={style.button} onClick={props.onSearch}>Buscar</button>
            <button className={style.buttonP} onClick={ () => alert('Emulamos que cambia de pagina')}>Prev</button>
            <p className={style.elementP}>{Cards.page}</p>
            <button className={style.buttonP} onClick={ () => alert('Emulamos que cambia de pagina')}>Next</button>
      </div>

   );
}
